import React from 'react'
import './HRPage.css'

const HRPage = () => {
  return (
    <div className="hr-page-container">
      <h1 className="hr-page-title">Human Resource Page</h1>
      <p className="hr-page-message">You must have been a Human resource personnel to access this page</p>
    </div>
  )
}

export default HRPage
